import React from "react";
import { Container, Row } from "./Main.elements";
const Main = () => {
  return (
    <div>
      <Container>
        <Row>
                  <h2>Get Instant Loan</h2>
                  <p>Get Instant</p>
        </Row>
        <Row>Ok</Row>
      </Container>
    </div>
  );
};

export default Main;
